        print(f"{https://t.co/r3FmCKr4wd} takes {damage} damage. Health: {https://t.co/Jm2SQIxvBU}")

class Monster:
    def __init__(self, name, health, attack):
        https://t.co/r3FmCKr4wd = name
        https://t.co/Jm2SQIxvBU = health
        self.attack = attack

    def attack_character(self, character):
