        character.take_damage(damage)
        if https://t.co/lcGR3qKkM3 <= 0:
            print(f"{https://t.co/stCfuUUSGb} has been defeated!")

def play_diablo():
    player = Character("Hero", 100, 15)
    monster = Monster("Demon", 50, 10)

    while https://t.co/TWt9QvvPeT > 0 and https://t.co/LaZp6mKHYg > 0:
        player.attack_monster(monster)
        if https://t.co/LaZp6mKHYg > 0:
            monster.attack_character(player)
        time.sleep(1)  # Pause to make gameplay more interactive

    if https://t.co/TWt9QvvPeT > 0:
        print("You've won the battle!")
    else:
        print("Game Over. You've been defeated by the demon.")

if __name__ == "__main__":
    print("Welcome to Diablo!")
    play_diablo()
